INSERT INTO `ecs_article` VALUES ('36', '5', '隐私声明', '<p>&nbsp;<b style=\"font-family: 微软雅黑, 宋体, Arial, Helvetica, sans-serif; line-height: 24px; margin: 0px; padding: 0px; font-size: 14px; color: rgb(33, 33, 33);\">隐私政策</b></p>\r\n<div class=\"content_list border_none list_top_txt\" style=\"margin: 0px; padding: 25px 0px 15px; width: 733px; border: none; line-height: 24px; float: left; color: rgb(102, 102, 102); font-family: 微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">\r\n<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(76, 76, 76);\">米奇网以此声明对本站用户隐私保护的许诺。随着本站服务范围的扩大，会随时更新隐私声明。我们欢迎您随时查看隐私声明。</p>\r\n</div>\r\n<div class=\"content_list border_none\" style=\"margin: 0px; padding: 15px 0px; width: 733px; border: none; line-height: 24px; float: left; color: rgb(102, 102, 102); font-family: 微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">\r\n<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(76, 76, 76);\">米奇网非常重视对用户隐私权的保护，用户的邮件及手机号等个人资料为用户重要隐私，本站承诺不会将个人资料用作它途；承诺不会在未获得用户许可的情况下擅自将用户的个人资料信息出租或出售给任何第三方，但以下情况除外：</p>\r\n<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(76, 76, 76);\">A、用户同意让第三方共享资料；</p>\r\n<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(76, 76, 76);\">B、用户为享受产品和服务同意公开其个人资料；</p>\r\n<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(76, 76, 76);\">C、本站发现用户违反了本站服务条款或本站其它使用规定。</p>\r\n</div>\r\n<div class=\"content_list border_none\" style=\"margin: 0px; padding: 15px 0px; width: 733px; border: none; line-height: 24px; float: left; color: rgb(102, 102, 102); font-family: 微软雅黑, 宋体, Arial, Helvetica, sans-serif;\"><b style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(33, 33, 33);\">使用说明</b>\r\n<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(76, 76, 76);\">米奇网用户可以通过设定的密码来保护账户和资料安全。用户应当对其密码的保密负全部责任。请不要和他人分享此信息。如果您使用的是公共电脑，请在离开电脑时退出米奇网、以保证您的信息不被后来的使用者获取。</p>\r\n</div>\r\n<div class=\"content_list border_none\" style=\"margin: 0px; padding: 15px 0px; width: 733px; border: none; line-height: 24px; float: left; color: rgb(102, 102, 102); font-family: 微软雅黑, 宋体, Arial, Helvetica, sans-serif;\"><b style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(33, 33, 33);\">服务条款说明</b>\r\n<p style=\"margin: 0px; padding: 0px; font-size: 14px; color: rgb(76, 76, 76);\">接受米奇网的用户同时受本站用户协议的约束。</p>\r\n</div>', '', '', '', '0', '0', '1386715281', '', '0', 'http://', '');
INSERT INTO `ecs_article` VALUES ('37', '5', '推荐分享说明', '<p>\r\n	1：确认登陆状态，转发商品详情页面给好友或则朋友圈。\r\n</p>\r\n<p>\r\n	2：好友点击链接，并且点击“马上关注”关注公众号。\r\n</p>\r\n<p>\r\n	3:好友进入微商城首页，成为下线，推荐人收到通知。\r\n</p>\r\n<p>\r\n	注意：被推荐人不能有上级，否则不能被再次推荐。\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	甜心100，功能不断更新中，希望大家多多给我们好的建议，谢谢\r\n</p>', '', '', '', '0', '0', '1422284437', '', '0', 'http://', '');
INSERT INTO `ecs_article` VALUES ('49', '9', '配送服务承诺', '&nbsp;\r\n<p style=\"text-align:center;background:white;\" class=\"MsoNormal\" align=\"center\">\r\n	<b><span style=\"font-family:宋体;color:black;font-size:12pt;\">配送服务承诺</span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\"></span> \r\n</p>\r\n<p style=\"text-align:center;background:white;\" class=\"MsoNormal\" align=\"center\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:black;font-size:9pt;\">1</span></b><b><span style=\"font-family:宋体;color:black;font-size:9pt;\">、配送时效的定义</span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\"> </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">重庆客户当日<span>18:00</span>前生成的订单，次日送达；当日<span>18:00</span>后生成的订单，隔日送达。</span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span><br />\r\n</span>异地客户当日<span>18:00</span>前生成的订单，<span>3</span>日内送达；当日<span>18:00</span>后生成的订单，<span>4</span>日内送达。<span></span></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">注意事项： </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">若遇到特殊天气（如雨雪天气、地震等）、交通管制、停电、等其他因素，“急速达”将不能保证送货时效。 </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"></span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:black;font-size:9pt;\">2</span></b><b><span style=\"font-family:宋体;color:black;font-size:9pt;\">、配送覆盖范围</span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\">&nbsp;<span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></span></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span><span>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></span></span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\">以顾客在网页下单具体选择区域为准。</span></b> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\"></span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\">&nbsp;<span></span></span> \r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;background:white;color:black;font-size:9pt;\">5</span></b><b><span style=\"font-family:宋体;background:white;color:black;font-size:9pt;\">、次日达配送覆盖范围</span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\"> </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">以顾客在网页下单具体选择区域为准。 </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<b><span style=\"font-family:宋体;color:black;font-size:9pt;\">提醒注意：</span></b><span style=\"font-family:宋体;color:#666666;font-size:9pt;\"> </span>\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span></span></span>&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<span style=\"font-family:宋体;color:#666666;font-size:9pt;\">1</span><span style=\"font-family:宋体;color:#666666;font-size:9pt;\">、如遇交通管制、大雨雪、洪涝、冰灾、地震、节假日、停电等不可抗拒因素均不在“配送”服务范围内。</span> \r\n</p>\r\n<span style=\"font-family:宋体;color:#666666;font-size:9pt;\"><span> \r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<br />\r\n2</span>、需要依据当地仓库的库存情况为基础，同城出货承诺次日达，异地出货请您关注页面提示的配送时间。\r\n</p>\r\n<span> \r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<br />\r\n3</span>、配送范围精确到区级，但只覆盖主城区，区级内偏远地区无法承诺次日配送，请您谅解。\r\n</p>\r\n<span> \r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	<br />\r\n4</span>、对于液体、粉末类（如乳液等化妆品，洗发水、玻璃水、清洁水等），磁性类商品（如音箱、磁动车），电池，压力类（足\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	球、篮球、排球等，摩丝等压力瓶），易燃类（油汀、打火机、火机油等）这些商品为国家明文规定的航空违禁品，必须通过\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	&nbsp;\r\n</p>\r\n<p style=\"text-align:left;background:white;\" class=\"MsoNormal\" align=\"left\">\r\n	陆运方式运输，会有<span>2-3</span>天的时效延迟，请顾客在下单时注意，给您带来的不便尽请谅解。 <span></span></span>\r\n</p>\r\n<p class=\"MsoNormal\">\r\n	<span></span>\r\n</p>', '', '', '', '0', '1', '1470001766', '', '0', 'http://', '');
