INSERT INTO `ecs_goods` VALUES ('8', '3', 'ECS000008', ' 香奈儿coco小姐唇膏（62#）3g', '+', '51', '1', '19', '', '1', '0.075', '300.00', '238.00', '0.00', '0', '0', '1', '双模 2008年春 黑色 直板 中低档', '独特色彩因子和柔软细腻质地，赋予双唇丝般的润泽效果及迷人光彩！', '<p align=\"left\">作为一款性价比极高的入门级<font size=\"3\" color=\"#ff0000\"><strong>商务手机</strong></font>，飞利浦<a href=\"mailto:9@9v\">Xenium&nbsp; 9@9v</a>三围大小为105&times;44&times;15.8mm，机身重量仅为<strong><font size=\"3\" color=\"#ff0000\">75g</font></strong>，装配了一块低规格1.75英寸128&times;160像素65000色CSTN显示屏。身正面采用月银色功能键区与屏幕数字键区相分隔，键盘设计较为<font size=\"3\"><strong><font color=\"#ff0000\">别</font><font color=\"#ff0000\">致</font></strong></font>，中部导航键区采用钛金色的&ldquo;腰带&rdquo;彰显出浓郁的商务气息。</p>\r\n<p align=\"left\">&nbsp;</p>\r\n<p align=\"left\">此款手机采用<strong><font size=\"3\" color=\"#ff0000\">触摸屏</font></strong>设计，搭配精致的手写笔，可支持手写中文和英文两个版本。增强的内置系统还能识别潦草字迹，确保在移动中和匆忙时输入文字的识别率。手写指令功能还支持特定图案的瞬间调用，独特的手写记事本功能，可以在触摸屏上随意绘制个性化的图案并进行<strong><font size=\"3\" color=\"#ff0000\">记事提醒</font></strong>，让商务应用更加随意。</p>\r\n<p align=\"left\">&nbsp;</p>\r\n<p align=\"left\">&nbsp;作为入门级为数不多支持<strong><font size=\"3\" color=\"#ff0000\">双卡功能</font></strong>的手机，可以同时插入两张SIM卡，通过菜单随意切换，只需开启漫游自动切换模式，<a href=\"mailto:9@9V\">9@9V</a>在该模式下能够判断网络情况，自动切换适合的手机号。</p>\r\n<p align=\"left\">&nbsp;</p>\r\n<p align=\"left\">&nbsp;</p>', 'images/201311/thumb_img/8_thumb_G_1384988790593.gif', 'images/201311/goods_img/8_G_1384988790722.jpg', 'images/201311/source_img/8_G_1384988790762.jpg', '1', '', '1', '1', '0', '2', '1241425512', '100', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('9', '23', 'ECS000009', '雅诗兰黛第六代特润精华露50ml', '+', '442', '1', '2', '', '1', '0.121', '950.00', '669.00', '0.00', '0', '0', '1', 'SMS EMS MMS 短消息群发 语音 阅读器 SMS,EMS,MMS,短消息群发语音合成信息阅读器 黑色 白色 滑盖', 'No.1畅销精华，1滴，渗透滋润，立现柔滑细嫩，4周，隐退细纹，透现饱满光泽。', '<p>在机身材质方面，诺基亚E66大量采用金属材质，刨光的金属表面光泽动人，背面的点状效果规则却又不失变化，时尚感总是在不经意间诠释出来，并被人们所感知。E66机身尺寸为<span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: larger;\"><strong>107.5&times;49.5&times;13.6毫米，重量为121克</strong></span></span>，滑盖的造型竟然比E71还要轻一些。</p>\r\n<p>&nbsp;</p>\r\n<div>诺基亚E66机身正面是<span style=\"color: rgb(255, 0, 0);\"><span style=\"font-size: larger;\"><strong>一块2.4英寸1600万色QVGA分辨率（240&times;320像素）液晶显示屏</strong></span></span>。屏幕上方拥有光线感应元件，能够自适应周 围环境光调节屏幕亮度；屏幕下方是方向功能键区。打开滑盖，可以看到传统的数字键盘，按键的大小、手感、间隔以及键程适中，手感非常舒适。</div>\r\n<div>&nbsp;</div>\r\n<div>诺基亚为E66配备了一颗320万像素自动对焦摄像头，带有LED 闪光灯，支持多种拍照尺寸选择。</div>\r\n<p>&nbsp;</p>', 'images/201311/thumb_img/9_thumb_G_1384987018566.gif', 'images/201311/goods_img/9_G_1384987018919.jpg', 'images/201311/source_img/9_G_1384987018328.jpg', '1', '', '1', '1', '0', '6', '1241511871', '0', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '6', '3', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('10', '49', 'ECS000010', '思亲肤90度卷长睫毛膏10g', '+', '97', '6', '24', '', '5', '0.000', '78.00', '49.90', '0.00', '0', '0', '1', '2008年05月 GSM,850,900,1800,1900 直板 黑色 白色', '香蕉90度卷长睫毛膏 天然腊和高机能的特殊支撑成分，能有效支撑下垂的睫毛，立即呈现90度放大的亮眼。', '<p>C702可以说是一种在外观上复古的产物，不仅延续T系列早期的直板造型，而且在屏幕和键盘的组合分布上都继承了前辈的精髓。C702的机身尺寸为106&times;48&times;15.5毫米，重量为105克。此外索尼爱立信为C702融入了<font size=\"3\" color=\"#ff0000\"><strong>三防特性，即防尘、防滑和防水溅</strong></font>，这款新的C702搭载了索尼爱立信经典A200平台，界面布局与W908c、K858c一致，典型的特征就是配备左右软键、中央确定键和通话/挂机键。</p>\r\n<p>索尼爱立信C702配备一块<strong><font size=\"3\" color=\"#ff0000\">2.2英寸26万色TFT液晶显示屏</font></strong>，分辨率为240&times;320像素(QVGA)，显示效果属于目前主流水准。C702可以说是索尼爱立信首批<strong><font size=\"3\" color=\"#ff0000\">内置GPS模块</font></strong>的 手机产品之一，C702的搜星、定位一气呵成，十分精准，误差大约在10米之内。基本上定位后可以将有效卫星数量控制在4&mdash;6颗，可以说可以满足我们的需 要了。C702还提供了&ldquo;影像定位&rdquo;功能，配合内置的AGPS全球定位辅助系统，只须启动Geo-Tagging智能影像定位功能，便可将拍摄地点记录在 照片内，方便用户随时查询。</p>\r\n<p>&nbsp;</p>\r\n<p>作为一款Cyber-shot系列影像手机，索尼爱立信C702在拍照功能方面同样有不俗的表现。并且手机内置的<strong><font size=\"3\" color=\"#ff0000\">320万像素摄像头</font></strong>也 同样在拍照功能上也不错的表现。不仅支持自动聚焦和双LED闪光功能，而且还拥有2倍数码变焦、防红眼、Photo fix优画及场景模式等功能。索尼爱立信C702除了配备的是最大光圈为F3.2的4.2毫米镜头之外，该机也如同门中的旗舰C902一样增加了对脸部有 先自动聚焦功能的支持。</p>\r\n<p>&nbsp;</p>', 'images/201311/thumb_img/10_thumb_G_1385076352897.jpg', 'images/201311/goods_img/10_G_1385076352496.jpg', 'images/201311/source_img/10_G_1385076352790.png', '1', '', '1', '1', '0', '0', '1241965622', '100', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('12', '24', 'ECS000012', '雅顿保湿调理露200ml', '+', '151', '7', '13', '', '3000', '0.000', '200.00', '78.00', '0.00', '0', '0', '1', 'SMS EMS MMS pda 摄像 智能 音乐 SMS,EMS,MMS', '使肌肤光滑水嫩， 补充水份，提升肌肤自身的保湿能力，让肌肤由内而外水嫩光彩。', '<p>全机使用的材质除去电池盖部分采用了金属以外，其它均使用了ABS工程塑料作为主材，这款手机的三围是105&times;51&times;14毫米，有着100克的轻量级重量，拿在手中的感觉还是非常不错的。A810手机作为一款<strong><font size=\"3\" color=\"#ff0000\">PDA手机</font></strong>在设计的时候取消了键盘配置，一切数字键都要依靠手机内提供的虚拟键盘进行操作，在手机的左上侧是一个<strong><font size=\"3\" color=\"#ff0000\">3.5mm的标准耳机插口</font></strong>，这种设计可以让用户使用自己习惯或者喜欢的耳机去欣赏音乐。</p>\r\n<p>&nbsp;</p>\r\n<p>这款摩托罗拉A810手机配置了一块<font size=\"3\" color=\"#ff0000\"><strong>26万色的2.2英寸TFT全触摸屏幕</strong></font>，其分辨率达到了主流的QVGA水平（240&times;320像素），摩托罗拉A810采用了内部核心为2.6.10的<strong><font size=\"3\" color=\"#ff0000\">LINUX操作系统</font></strong>，菜单上依然采用传统的9宫格的显示方式，一般手机的名片式电话本只能支持诸如电话、邮件、传真、公司等一些基本信息，而A810手机的电话本除了这些还支持公司地址，配偶信息、子女姓名、上司名称、助手等等，对于一款手机来说，电话本不可谓不强大。A810的<strong><font size=\"3\" color=\"#ff0000\">手写识别能力相当的惊人</font></strong>，对连笔、草书和倒插笔的识别率都相当的高，同时还为左右手设置了不同的书写习惯选择，并支持手写速度的调节。</p>\r\n<p>这款A810手机<strong><font size=\"3\" color=\"#ff0000\">内置的音乐播放功能</font></strong>可以支持MP3、WAV、AMR、AAC等格式的音乐播放，<font size=\"3\" color=\"#ff0000\"><strong>支持后台播放</strong></font>。视频方面，这款A810支持MP4、3GP、H.263格式的播放，视频播放器同样简约，操作方便，这款摩托罗拉A810还内置了6款游戏，每一款都有很高的耐玩性，而且都是支持触摸屏操作的，同时这款手机还内置了<strong><font size=\"3\" color=\"#ff0000\">FM收音机</font></strong>，支持自动搜索，并提供了20个频道供用户存储，不过收音机并不支持后台播放。</p>\r\n<p>&nbsp;</p>', 'images/201311/thumb_img/12_thumb_G_1384995644320.jpg', 'images/201311/goods_img/12_G_1384995644760.jpg', 'images/201311/source_img/12_G_1384995644283.jpg', '1', '', '1', '1', '0', '0', '1245297652', '100', '1', '0', '0', '0', '0', '2', '1470937264', '11', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('13', '52', 'ECS000013', '欧莱雅绝配无暇粉底液N1#象牙色', '+', '32', '1', '23', '', '8', '0.000', '198.00', '109.00', '0.00', '0', '0', '1', '摄像 智能 音乐 蓝色 红色 舒适 直板 中档 2008年07月 黑色 GSM,850,900,1800,1900', '', '<p>诺基亚5320XpressMusic音乐手机采用XpressMusic系列常见的黑红、黑蓝配色方案，而材质方便则选用的是经过<strong><font size=\"3\" color=\"#ff0000\">抛光处理</font></strong>的工程塑料；三围/体重为，为108&times;46&times;15mm/<strong><font size=\"3\" color=\"#ff0000\">90g</font></strong>，手感舒适。</p>\r\n<p>&nbsp;</p>\r\n<p>诺基亚5320采用的是一块可视面积为2.0英寸的<font size=\"3\" color=\"#ff0000\"><strong>1600万色</strong></font>屏幕，分辨率是常见的240&times;320像素（QVGA）。虽然屏幕不是特别大，但效果非常精细，色彩还原不错。</p>\r\n<p>&nbsp;</p>\r\n<p>手机背面，诺基亚为5320XM配备一颗<strong><font size=\"3\" color=\"#ff0000\">200W像素</font></strong>的摄像头，并且带有<strong><font size=\"3\" color=\"#ff0000\">两个LED的补光灯</font></strong>，可以实现拍照、摄像功能，并能通过彩信、邮件方式发送给朋友。</p>\r\n<p>&nbsp;</p>', 'images/201311/thumb_img/13_thumb_G_1385076209182.jpg', 'images/201311/goods_img/13_G_1385076209469.jpg', 'images/201311/source_img/13_G_1385076209542.jpg', '1', '', '1', '1', '0', '1', '1241967762', '100', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('14', '51', 'ECS000014', '谜尚红色BB霜21#50ml', '+', '19', '0', '22', '', '1', '0.000', '208.00', '99.00', '0.00', '0', '0', '1', 'GSM 64和弦 2009年2月 320万摄像头 GPS 直板 工程塑料 支持 2008年10月 黑色', '', '', 'images/201311/thumb_img/14_thumb_G_1385076093787.jpg', 'images/201311/goods_img/14_G_1385076093307.jpg', 'images/201311/source_img/14_G_1385076093051.png', '1', '', '1', '1', '0', '0', '1241968492', '100', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('238', '169', '0123456', '爱慕秋季新品刺绣女士内衣', '+', '70', '0', '74', '', '1000', '0.000', '190.00', '159.00', '0.00', '0', '0', '1', '', '', '<img src=\"/includes/kindeditor/php/../../../images/upload/image/20160806/20160806145559_83984.jpg\" alt=\"\" /><img src=\"/includes/kindeditor/php/../../../images/upload/image/20160806/20160806145600_74330.jpg\" alt=\"\" />', 'images/201608/thumb_img/238_thumb_G_1470437930363.jpg', 'images/201608/goods_img/238_G_1470437930848.jpg', 'images/201608/source_img/238_G_1470437930318.png', '1', '', '1', '1', '0', '1', '1470436616', '100', '1', '1', '1', '1', '0', '0', '1470936672', '13', '', '-1', '-1', '0', null, '<img src=\"/includes/kindeditor/php/../../../images/upload/image/20160806/20160806152557_89156.png\" alt=\"\" /><img src=\"/includes/kindeditor/php/../../../images/upload/image/20160806/20160806152557_48839.png\" alt=\"\" /><img src=\"/includes/kindeditor/php/../../../images/upload/image/20160806/20160806152557_62871.png\" alt=\"\" /><img src=\"/includes/kindeditor/php/../../../images/upload/image/20160806/20160806152558_89109.png\" alt=\"\" /><img src=\"/includes/kindeditor/php/../../../images/upload/image/20160806/20160806152558_11406.png\" alt=\"\" /><img src=\"/includes/kindeditor/php/../../../images/upload/image/20160806/20160806152558_17187.png\" alt=\"\" />', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('16', '2', 'ECS000016', '雅诗兰黛鲜活营养红石榴眼霜15ml', '+', '330', '3', '0', '', '3000', '0.000', '481.00', '355.00', '0.00', '0', '0', '1', '', '', '', 'images/201311/thumb_img/16_thumb_G_1384995428649.jpg', 'images/201311/goods_img/16_G_1384995428821.jpg', 'images/201311/source_img/16_G_1384995428103.jpg', '1', '', '1', '1', '0', '3', '1241968949', '100', '1', '0', '0', '0', '0', '2', '1470937264', '11', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('17', '20', 'ECS000017', '娇韵诗超V型纤容紧致瘦脸面膜75ml', '+', '2007', '174', '0', '', '992', '0.000', '396.00', '275.00', '0.00', '0', '0', '1', '2008年01月 GSM,900,1800,1900,2100 直板 262144万 240×400 像素 SMS,EMS,MMS,超长信息发送,短消息群发 黑色 CDMA', '柔滑轻盈的慕斯乳霜质地，紧致并维护肤质，可消除浮肿，提升面部轮廓！', '<img src=\"/images/upload/image/20150228/20150228034345_13548.jpg\" alt=\"\" />', 'images/201502/thumb_img/17_thumb_G_1425037493452.jpg', 'images/201502/goods_img/17_G_1425037493307.jpg', 'images/201502/source_img/17_G_1425037493537.jpg', '1', '', '1', '1', '0', '2', '1241969394', '3', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '5', '', '', '0', '100');
INSERT INTO `ecs_goods` VALUES ('19', '31', 'ECS000019', '兰蔻精华眼膜霜15ml', '+', '282', '24', '1', '', '12', '0.000', '560.00', '429.00', '0.00', '0', '0', '1', '滑盖 GSM 258 时尚 蓝牙 黑色 金色 白色', '改善眼部基底和眼周围肌肤状况，立现名晰动人的双眸，明亮新生！', '<p>从整体来看，三星SGH-F258比较<font size=\"3\" color=\"#ff0000\"><strong>时尚</strong></font>可爱，三围尺寸为94&times;46&times;17.5mm，重量为96克，曲线柔和具有玲珑美感。</p>\r\n<p>&nbsp;</p>\r\n<p>三星F258的前面板整体应用<strong><font size=\"3\" color=\"#ff0000\">镜面效果</font></strong>，2.0英寸显示屏幕略显窄小，导航键与功能键在滑盖滑开之前是前面板的全部控制键，没有挂断和接听键，不过，五向键有<font size=\"3\"><strong><font color=\"#ff0000\">音乐操</font><font color=\"#ff0000\">作</font></strong></font>功能，明确显示了F258音乐手机的定位。</p>\r\n<p>&nbsp;</p>\r\n<p>F258的数字键键区采用了极具金属质感的平板式设计，每颗按键的面积足够大，按键与按键之间的间隔明显，操作起来手感舒适。</p>', 'images/201311/thumb_img/19_thumb_G_1384994159077.gif', 'images/201311/goods_img/19_G_1384994159884.jpg', 'images/201311/source_img/19_G_1384994159117.jpg', '1', '', '1', '1', '0', '4', '1241970139', '2', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '3', '0', '', '', '20', null);
INSERT INTO `ecs_goods` VALUES ('20', '3', 'ECS000020', '纪梵希幻影四宫格胭脂21#7g', '+', '33', '0', '21', '', '12', '0.000', '430.00', '259.00', '0.00', '0', '0', '1', 'GSM 直板 40和弦 金属材质 2008年07月 黑色 GSM,900,1800,1900,2100', '浅粉蜜桃色，柔玫瑰粉红，带少许珠光的蜜桃橘。打造水蜜桃甜滋滋的感觉。', '', 'images/201311/thumb_img/20_thumb_G_1384994312013.gif', 'images/201311/goods_img/20_G_1384994312529.jpg', 'images/201311/source_img/20_G_1384994312118.jpg', '1', '', '1', '1', '0', '2', '1241970417', '100', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('21', '47', 'ECS000021', '蜜丝佛陀纤柔眼线液1#0.75ml', '+', '216', '34', '10', '', '37', '0.000', '98.00', '75.00', '0.00', '0', '0', '1', '2008年03月 GSM,900,1800,1900,2100 直板 1600万 240×400 像素 2007年12月 200万摄像头 黑色', '', '<p>\r\n	<br />\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>标准配置: 标准锂电池两块,充电器两个,立体声耳机一个,数据线,说明书送256TF</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>通讯功能&nbsp; 输入法 短信功能 话机通讯录 通话记录</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>输入法: 中文输入法</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>短信功能: 支持短信300条和彩信100条</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>话机通讯录: 1000组名片式电话存储 来电防火墙功能&nbsp; 来电大头贴及来电铃声识别</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>通话记录：支持电话录音,恢复/静音,双音多频,免提</span></span>\r\n</p>\r\n<p>\r\n	<br />\r\n</p>\r\n<p>\r\n	<span>高级功能</span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>多媒体娱乐: 200万像素，最大支持10240*960，11级数码变焦,多种效果设置,连拍可全屏查看拍摄或下载的图片.支持有声MP4短片拍摄，录像时间根据内存 大小而定，拍摄录像,TV电视可跟朋友家人一起分享。支持网络摄像头功能 支持MPEG4、3GP(H.263)等视频格式 支持MP3等音频格式播放， 支持歌词播放</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>内置游戏:智能拼图</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>扩展存储功能:支持TF扩展,支持U盘功能,本机内置1M,随机赠送256TF卡</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>高级功能:直板/智能PDA手写/键盘输入 超长待机 WAP上网&nbsp; 录音 蓝牙 FM收音机 电子书 Java扩展 TV电视输出 声控语音拨号 免费电视 来电防火墙&nbsp;&nbsp;&nbsp;</span></span>\r\n</p>\r\n<p align=\"left\">\r\n	<span style=\"font-size:medium;\"><span>附加功能: 日历 计算器 闹钟 记事本 日程表 秒表 单位换算</span></span>\r\n</p>\r\n<p>\r\n	<span style=\"font-size:medium;\"><span>提醒 以上性能均为本公司员工试机后所写,产品资料仅供参考,请以收到实物为准</span></span>\r\n</p>', 'images/201311/thumb_img/21_thumb_G_1385075715191.jpg', 'images/201311/goods_img/21_G_1385075715772.jpg', 'images/201311/source_img/21_G_1385075715028.png', '1', '', '1', '1', '0', '0', '1241970634', '100', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', '10');
INSERT INTO `ecs_goods` VALUES ('22', '3', 'ECS000022', '娇兰金钻修颜粉饼SPF10', '+', '70', '3', '12', '', '1', '0.000', '750.00', '399.00', '0.00', '0', '0', '1', '500万摄像头 蓝牙 手写 GPS 办公应用 语音拨号 2008年12月 黑色 GSM,850,900,1800,1900 直板', '蕴含肌肤再生珍奇复合物，淡化皱纹，促进肌肤新生，恢复青春容颜！', '<p><img src=\"http://xgone.xgou.com/xgoumanage/upload/20090325/2009032502045081100887.jpg\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p><img src=\"http://www.ouku.com/upimg/ouku/Image/002(1).jpg\" alt=\"\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>', 'images/201311/thumb_img/22_thumb_G_1384994678955.gif', 'images/201311/goods_img/22_G_1384994678394.jpg', 'images/201311/source_img/22_G_1384994678769.jpg', '1', '', '1', '1', '0', '3', '1241971076', '100', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
INSERT INTO `ecs_goods` VALUES ('23', '58', 'ECS000023', ' 安娜苏魔影幻彩唇膏305#3.4g', '+', '160', '4', '20', '', '8', '0.000', '179.00', '149.00', '0.00', '0', '0', '1', '500万摄像头 microSD 工程塑料 蓝牙 数码相机 内置游戏 滑盖 高档 2008年09月 320×240 像素 黑色', '', '<p>诺基亚N96采用了<strong><font size=\"3\" color=\"#ff0000\">双向滑盖</font></strong>设计，机身整体呈灰黑色，沉稳、大气，机身材质采用了高强度的塑料材质，手机背面采用了抛光面板的设计风格。N96三维体积103*55*20mm，重量为125g。屏幕方面，诺基亚N96配备一块<strong><font size=\"3\" color=\"#ff0000\">2.8英寸</font></strong>的屏幕，支持<strong><font size=\"3\" color=\"#ff0000\">1670万色</font></strong>显示，分辨率达到QVGA（320&times;240）水准。</p>\r\n<p><img alt=\"\" src=\"file:///C:/DOCUME~1/user/LOCALS~1/Temp/moz-screenshot.jpg\" /></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;<img src=\"http://img2.zol.com.cn/product/21/896/ceN6LBMCid3X6.jpg\" alt=\"\" /></p>\r\n<p>诺基亚N96设置有专门的<strong><font size=\"3\" color=\"#ff0000\">音乐播放键</font></strong>和标准的3.5毫米音频插口，支持多格式音乐播放。内置了<strong><font size=\"3\" color=\"#ff0000\">多媒体播放器</font></strong>，支持FM调频收音机等娱乐功能。N96手机支持<strong><font size=\"3\" color=\"#ff0000\">N-Gage游戏平台</font></strong>，内置包括<font size=\"3\" color=\"#ff0000\"><strong>《PinBall》完整版</strong></font>在内的四款N-Gage游戏，除了手机本身内置的游戏，还可以从N-Gage的网站下载或者购买最新的游戏，而且可以在论坛里和其他玩家一起讨论。</p>\r\n<p><img src=\"http://img2.zol.com.cn/product/21/898/cekkw57qJjSI.jpg\" alt=\"\" /></p>\r\n<p>&nbsp;</p>', 'images/201311/thumb_img/23_thumb_G_1385075287189.jpg', 'images/201311/goods_img/23_G_1385075287524.jpg', 'images/201311/source_img/23_G_1385075287823.jpg', '1', '', '1', '1', '0', '1', '1241971488', '100', '1', '0', '0', '0', '0', '2', '1470937264', '9', '', '-1', '-1', '0', '0', '', '0', '0', '', '', '0', null);
