INSERT INTO `ecs_goods` VALUES ('123', '92', 'ECS000123', '迪奥红毒女士香水EDT 50ml', '+', '1565', '11', '14', '', '9997', '0.000', '820.00', '459.00', '0.00', '0', '0', '1', '', '', '<div class=\"inLeft_orderDetail_in\" style=\"margin:0px;padding:0px;\">\r\n	<p style=\"color:#4C4C4C;font-size:14px;\">\r\n		<span style=\"font-family:Arial;\"><img src=\"http://img.miqi.cn/static/team/2012/0530/13383634752884.jpg\" alt=\"\" style=\"border:0px;\" />HYPNOTIC POISON蛊媚奇葩也是John Galliano，这位当代最富才华的设计师加入Dior后创作的第一款香水，在丰盈、馥郁而迷幻的香调间，HYPNOTIC POISON准确地捕捉到了激情的释放点，恰如一道神秘的咒语演绎着一种幻象，HYPNOTIC POISON在极端感性与激荡之间令人无法抗拒，诠释出令人目眩神迷的诱惑。<br />\r\n<strong><span style=\"color:#FF6666;\">精致瓶身：</span></strong>同POISON系列的其他款式一样，HYPNOTIC POISON蛊媚奇葩的瓶身亦十分贴合它自身的主题，人造红宝石闪动着深邃的魅力，诱惑一触即发。<br />\r\n<strong><span style=\"color:#FF6666;\">矛盾的香调：</span></strong>异常矛盾的一款香水，犹如女人的内心一般捉摸不定，散发神秘的魅力！<br />\r\n<strong><span style=\"color:#FF6666;\">清澈的前味：</span></strong>黎巴嫩玫瑰的清新娇艳让人一瞥惊鸿，清澈的酸味让人耳目一新。</span>\r\n	</p>\r\n	<p style=\"color:#4C4C4C;font-size:14px;\">\r\n		<span style=\"font-family:Arial;color:#FF6666;\"><strong>温暖厚重的中味：</strong></span><span style=\"font-family:Arial;\">乳脂的香味绵软厚重，久久不绝。轻嗅着温暖的乳香，心灵在慰藉中渐渐放松。Hypnotic，宛如催眠般的魔法蛊惑。<br />\r\n&nbsp;</span><strong><span style=\"color:#FF6666;\">矛盾复杂的后味：</span></strong><span style=\"font-family:Arial;\">乳脂香气中混合着辛咸，肉桂隐隐出没其间。那是一种极其复杂的情感。味道就像是好吃的咸奶油。乳脂的绵软厚重，包裹着咸味辛味的克制与压抑——就像是传说中的“禁欲主义者”。那是一种极端的刻意压制——只为保持身心的独立和清醒。如此压抑如此低迷，就连空气中都弥漫起一种理智和隐忍味道。这简直就像是理智与情感的斗争！理智压抑，情感冲击，就在这反反复复的矛盾纠结中，情感终于绽放出最热烈的诱惑！<br />\r\n</span>\r\n	</p>\r\n	<p style=\"color:#4C4C4C;font-size:14px;\">\r\n		<span style=\"font-family:Arial;\"><span style=\"color:#FF6666;\"><strong>香调：</strong></span>东方香调<br />\r\n<span style=\"color:#FF6666;\"><strong>前调：</strong></span>苦杏仁：生长于意大利寒冷的南方，前调透着隐约的苦味。<br />\r\n<span style=\"color:#FF6666;\"><strong>中调：</strong></span>茉莉：是女性柔美的象征。茉莉花是世界上香水提炼中最常用到的香料，它是有自己独特的香味又非常易碎的花种，时而狂野和奔放，时而又像朝露一般纯洁。<br />\r\n<span style=\"color:#FF6666;\"><strong>后调：</strong></span>香草：有一点甜甜的味道。</span>\r\n	</p>\r\n	<div>\r\n		<span style=\"font-family:Arial;\"><br />\r\n</span>\r\n	</div>\r\n</div>', 'images/201312/thumb_img/123_thumb_G_1385947952157.jpg', 'images/201312/goods_img/123_G_1385945992313.jpg', 'images/201312/source_img/123_G_1385945992273.jpg', '1', '', '0', '1', '0', '4', '1385940473', '100', '1', '0', '0', '0', '0', '0', '1470937332', '11', '', '-1', '-1', '0', '0', '<p>\r\n	&nbsp;<img src=\"http://img2.miqi.cn/static/team/2012/0530/13383667358915.jpg\" alt=\"迪奥红毒女士香水EDT 50ml，宝石般神秘精致的瓶身，矛盾的香调，给您带来嗅觉上的冲击，制造神秘、奢华、野性而女性化的感觉。\" style=\"border:0px;\" />\r\n</p>\r\n<p>\r\n	<span style=\"color:#4C4C4C;font-size:14px;line-height:24px;font-family:微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">迪奥红毒女士香水EDT 50ml，宝石般神秘精致的瓶身，矛盾的香调，给您带来嗅觉上的冲击</span>\r\n</p>\r\n<p>\r\n	<span style=\"color:#4C4C4C;font-size:14px;line-height:24px;font-family:微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">，制造神秘、奢华、野性而女性化的感觉。</span>\r\n</p>\r\n<p>\r\n	<img src=\"http://img2.miqi.cn/static/team/2012/0716/13424268608667.jpg\" alt=\"本产品分为两种版本，随机发货，如图为产品底部对比图，请注意。\" style=\"border:0px;\" />\r\n</p>\r\n<p>\r\n	<span style=\"color:#4C4C4C;font-size:14px;line-height:24px;font-family:微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">本产品分为两种版本，随机发货，如图为产品底部对比图，请注意。</span>\r\n</p>\r\n<p>\r\n	<img src=\"http://img2.miqi.cn/static/team/2012/0530/13383667364053.jpg\" alt=\"MM们注意了，商品迪奥红毒女士香水EDT 50ml，为全新专柜正装，有外盒有塑封。\" style=\"border:0px;\" />\r\n</p>\r\n<p>\r\n	<span style=\"color:#4C4C4C;font-size:14px;line-height:24px;font-family:微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">MM们注意了，商品迪奥红毒女士香水EDT 50ml，为全新专柜正装，有外盒有塑封。</span>\r\n</p>\r\n<p>\r\n	<img src=\"http://img2.miqi.cn/static/team/2012/0530/13383667375748.jpg\" alt=\"HYPNOTIC POISON恰如一道神秘的咒语演绎着一种幻象，诠释出令人目眩神迷的诱惑。\" style=\"border:0px;\" />\r\n</p>\r\n<p>\r\n	<span style=\"color:#4C4C4C;font-size:14px;line-height:24px;font-family:微软雅黑, 宋体, Arial, Helvetica, sans-serif;\">HYPNOTIC POISON恰如一道神秘的咒语演绎着一种幻象，诠释出令人目眩神迷的诱惑。</span>\r\n</p>\r\n<p>\r\n	<img src=\"http://img2.mi